INSERT INTO activities (id, time, title, content, status, slug, cover_img, created_at, updated_at) VALUES (4, null, 'Phối hợp thực hiện bảo trợ trẻ em chuẩn bị cho mùa đông sắp tới', '<div data-testid="post_message" class="_5pbx userContent _3576" data-ft="{&quot;tn&quot;:&quot;K&quot;}" id="js_1o6" style="font-size: 14px; line-height: 1.38; margin-top: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33);"><div style="text-align: justify;"><span style="font-family: inherit;">Ngày 07/12/2019 Quỹ Bảo trợ trẻ em tỉnh Điện Biên phối hợp với Nhóm Les Amis De Montreal, nhóm Thiện nguyện Hoa Ban Điện Biên trao tặng chăn, màn, áo ấm, giầy, balô, sách vở... cho thầy và trò Điểm trường Háng Sua - Trường PTDTBT Tiểu học Tìa Dình và tặng mũ len đa năng, chăn ấm cho Trường mầm non Háng Sua với tổng kinh phí là 80 triệu đồng. Những món quà đầy ý nghĩa này sẽ phần nào sưởi ấm cho những trái tim bé bỏng trong trong mùa đông lạnh giá nơi đây.</span></div><p style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; display: inline; font-family: inherit;"><br></p><div style="text-align: center;"><img src="data:image/jpeg;base64," data-filename="79220649_1026365667721121_2973254792136097792_n.jpg" style="font-family: inherit; width: 50%;"></div><p></p><p style="margin-right: 0px; margin-bottom: 0px; margin-left: 0px; display: inline; font-family: inherit;"><br></p><div style="text-align: center;"><img src="data:image/jpeg;base64,', null, 'phoi-hop-thuc-hien-bao-tro-tre-em-chuan-bi-cho-mua-dong-sap-toi5df3ab56c7ca1', '/uploads/1576250198_7800659_8fa2c9e6b833c46b5f83c9ff4a8bde78.jpg', '2019-12-13 15:16:38', '2019-12-13 15:16:38');
INSERT INTO activities (id, time, title, content, status, slug, cover_img, created_at, updated_at) VALUES (5, null, 'Hoạt động từ thiện tại hai Trường mầm non Tủa Thàng số 1 và Tủa Thàng số 2', '<div style="text-align: justify;"><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;"><br></span></div><div style="text-align: justify;"><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;">600 chiếc mũ đa năng nhiều mầu sắc được Quỹ Bảo trợ trẻ em tỉnh Điện Biên trao tặng cho các em nhỏ ở 02 Trường mầm non Tủa Thàng số 1 và Tủa Thàng số 2. Các em đã vô cùng yêu thích món quà này, mỗi em tự chọn cho mình chiếc mũ ưng nhất, cùng giúp nhau đội lên đầu, rất thích thú khi được chụp ảnh...</span></div><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;"><div style="text-align: justify;">Những chiếc mũ nhỏ xinh vừa là mũ đội đầu vừa là khăn quàng giữ ấm cổ cho mùa đông sắp tới. Đó là món quà mà các bà, các mẹ, các chị...nhóm Ong chăm Hà Nội đã cẩn thận đan cho các em cũng là một cách đem hơi ấm lên vùng cao. Hãy cùng chúng tôi Quỹ Bảo trợ trẻ em tỉnh Điện Biên có những hành động thiết thực dù nhỏ, dù lớn mang đến cho trẻ em, đặc biệt trẻ em có hoàn cảnh khó khăn, trẻ em vùng cao những điều tốt đẹp !</div><div style="text-align: center;"><br></div><div style="text-align: center;"><img src="data:image/jpeg;base64," data-filename="74889332_1002616520096036_4700206625837809664_n (1).jpg" style="width: 50%;"></div><div style="text-align: center;"><br></div><div style="text-align: center;"><img src="data:image/jpeg;base64,', null, 'hoat-dong-tu-thien-tai-hai-truong-mam-non-tua-thang-so-1-va-tua-thang-so-25df3b7584b8e7', '/uploads/1576253272_6791151_ecae8c865eb8727ca711aaf0ae8648af.jpg', '2019-12-13 16:07:52', '2019-12-13 16:07:52');
INSERT INTO activities (id, time, title, content, status, slug, cover_img, created_at, updated_at) VALUES (6, null, 'Nâng bước tương lai: Chương trình khám miễn phí phát hiện sớm bệnh tim bẩm sinh cho trẻ em trên địa bàn tỉnh Điện Biên năm 2019', '<p style="text-align: justify;"><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;">Chương trình khám sàng lọc miễn phí phát hiện sớm bệnh tim bẩm sinh năm 2019 do Quỹ Bảo trợ trẻ em tỉnh phối hợp với Bệnh viện Tim Hà Nội và Bệnh viện Đa khoa tỉnh Điện Biên đã thành công tốt đẹp với 850 cháu tham gia chương trình, 178 cháu được chỉ định siêu âm, 33 cháu chỉ định phẫu thuật và 04 cháu cần phải theo dõi. Quỹ Bảo trợ trẻ em tỉnh xin gửi lời cảm ơn sâu sắc tới các Bác sỹ của Bệnh viện Tim Hà Nội, Bệnh viện Đa khoa tỉnh Điện Biên, Quỹ Bảo trợ trẻ em Việt Nam và các nhà hảo tâm đã ủng hộ và giúp đỡ cho các cháu tham gia chương trình&nbsp;</span></p><p style="text-align: center;"><img src="data:image/jpeg;base64," data-filename="73395479_993128344378187_7213215647407276032_n.jpg" style="width: 50%;"></p><p style="text-align: center;"><br></p><p style="text-align: center;"><img src="data:image/jpeg;base64," data-filename="74525037_993128161044872_6329331516992126976_n.jpg" style="width: 50%;"></p><p style="text-align: center;"><br></p><p style="text-align: center;"><img src="data:image/jpeg;base64,', null, 'nang-buoc-tuong-lai-chuong-trinh-kham-mien-phi-phat-hien-som-benh-tim-bam-sinh-cho-tre-em-tren-dia-ban-tinh-dien-bien-nam-20195df3bd9b4fb90', '/uploads/1576254875_1286285_e8fdc34e99d8208206e790f651981c91.jpg', '2019-12-13 16:34:35', '2019-12-13 16:34:35');
INSERT INTO activities (id, time, title, content, status, slug, cover_img, created_at, updated_at) VALUES (7, null, 'Nâng bước tương lai: hoạt động trao tặng 20 suất học bổng, mỗi suất trị giá 1 triệu đồng cho 20 em có hoàn cảnh đặc biệt khó khăn vượt khó vươn lên đạt kết quả cao trong học tập', '<p><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;">Tiếp tục hành trình "Nâng bước tương lai" do Quỹ Bảo trợ trẻ em tỉnh Điện Biên phối hợp với Công ty Bảo hiểm nhân thọ Prudential trao tặng 20 suất học bổng, mỗi suất trị giá 1 triệu đồng cho 20 em có hoàn cảnh đặc biệt khó khăn vượt khó vươn lên đạt kết quả cao trong học tập thuộc các xã Keo Lôm, Na Son, Noong U và Thị trấn của huyện Điện Biên Đông.</span><br></p><p style="text-align: center; "><img src="data:image/jpeg;base64," data-filename="69722428_1001430246881330_5481758036529774592_n.jpg" style="width: 50%;"></p><p style="text-align: center; "><img src="data:image/jpeg;base64," data-filename="72156704_1001430120214676_4116654045010067456_n.jpg" style="width: 50%;"></p><p style="text-align: center; "><img src="data:image/jpeg;base64,', null, 'nang-buoc-tuong-lai-hoat-dong-trao-tang-20-suat-hoc-bong-moi-suat-tri-gia-1-trieu-dong-cho-20-em-co-hoan-canh-dac-biet-kho-khan-vuot-kho-vuon-len-dat-ket-qua-cao-trong-hoc-tap5df3c23158cd2', '/uploads/1576256049_1062779_02a6c0b09f6d3229cfe34d71ac7dcf19.jpg', '2019-12-13 16:54:09', '2019-12-13 16:54:09');
INSERT INTO activities (id, time, title, content, status, slug, cover_img, created_at, updated_at) VALUES (8, null, 'Nâng bước tương lai: Chương trình khám miễn phí phát hiện sớm bệnh tim bẩm sinh cho trẻ em trên địa bàn tỉnh Điện Biên năm 2019 - Ngày thứ nhất', '<div data-testid="post_message" class="_5pbx userContent _3576" data-ft="{&quot;tn&quot;:&quot;K&quot;}" id="js_zoa" style="text-align: justify; font-size: 14px; line-height: 1.38; margin-top: 6px; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33);"><div style="text-align: left;"><p style="font-family: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; display: inline;">Ngày thứ nhất của Chương trình khám miễn phí phát hiện sớm bệnh tim bẩm sinh cho trẻ em trên địa bàn tỉnh Điện Biên tại Trung tâm Y tế huyện Tuần Giáo đã kết thúc tốt đẹp với 380 cháu tham gia khám sàng lọc, 85 cháu chỉ định siêu âm tim, 14 cháu chỉ định phẫu thuật (huyện Tuần Giáo: 09 cháu, huyện Tủa Chùa: 04 cháu, huyện Mường ẳng: 01 cháu). Hy vọng vào ngày khám thứ 2 (3/11/2019) các cháu có dấu hiệu bị bệnh Tim bẩm sinh sẽ tiếp tục được các bác sĩ Bệnh viện Tim Hà Nội, Bệnh viện Đa khoa tỉnh phát hiện sớm để có chỉ định điều trị cho các cháu.</p><p style="font-family: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; display: inline;"><br></p><p style="font-family: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; display: inline;"><br></p><p style="font-family: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; display: inline;"><br></p><p style="font-family: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; display: inline;"><img src="data:image/jpeg;base64," data-filename="73068605_992087124482309_6425614208343212032_n.jpg" style="width: 960px;"></p><p style="font-family: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; display: inline;"><br></p><p style="font-family: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; display: inline;"><br></p><p style="font-family: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; display: inline;"><img src="data:image/jpeg;base64,', null, 'nang-buoc-tuong-lai-chuong-trinh-kham-mien-phi-phat-hien-som-benh-tim-bam-sinh-cho-tre-em-tren-dia-ban-tinh-dien-bien-nam-2019-ngay-thu-nhat5df3c4af9f3fb', '/uploads/1576256940_7534285_cd17729c54ccf0a01604227d9028086f.jpg', '2019-12-13 17:04:47', '2019-12-13 17:09:00');
INSERT INTO activities (id, time, title, content, status, slug, cover_img, created_at, updated_at) VALUES (9, null, 'Thông báo: Tổ chức khám sàng lọc, phát hiện sớm bệnh tim cho trẻ em trên địa bàn tỉnh Điện Biên', '<span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;">Quỹ Bảo trợ trẻ em tỉnh Điện Biên xin trân trọng thông báo:</span><br style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;"><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;">Từ ngày 02-03/11/2019, Quỹ Bảo trợ trẻ em – Sở Lao động -Thương Binh và Xã hội tỉnh Điện Biên phối hợp với Bệnh viện Tim Hà Nội, Bệnh viện Đa khoa tỉnh tổ chức khám sàng lọc, phát hiện sớm bệnh tim cho trẻ em trên địa bàn tỉnh Điện Biên.</span><br style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;"><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;">Tại tuyến huyện:</span><br style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;"><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;">- Thời gian: từ 7h30 ngày 2/11/2019</span><br style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;"><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;">- Địa điểm: Trung tâm Y tế huyện Tuần Giáo bao gồm các huyện Tuần Giáo, Tủa&nbsp;</span><span class="text_exposed_show" style="display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;">Chùa, Mường Ẳng.<br>Tại tuyến tỉnh:<br>- Thời gian: từ 7h30 ngày 3/11/2019<br>- Địa điểm: Bệnh viện Đa khoa tỉnh Điện Biên.<br>Thành phần tham gia khám sàng lọc:<br>- Các Chuyên gia, Bác sỹ Bệnh viện Tim Hà Nội<br>- Các Bác sỹ, điều dưỡng Bệnh viện Đa khoa tỉnh và Trung tâm y tế huyện Tuần Giáo.<br>Đối tượng: Trẻ em độ tuổi từ 0 đến 16 tuổi nghi bị tim bẩm sinh<br>Vì vậy kính đề nghị các gia đình có trẻ bị nghi mắc tim bẩm sinh, đến các Trung tâm Y tế huyện Tuần Giáo và Bệnh viện Đa khoa tỉnh để được khám và tư vấn miễn phí.<br>Mọi thắc mắc xin liên hệ: Quỹ Bảo trợ trẻ em tỉnh Điện Biên; Địa chỉ: tổ 17, phường Mường Thanh, thành phố Điện Biên Phủ, tỉnh Điện Biên. SĐT: 02153.833.962/0986.622.808<br>Quỹ Bảo trợ trẻ em tỉnh Điện Biên trân trọng thông báo./.</span>', null, 'thong-bao-to-chuc-kham-sang-loc-phat-hien-som-benh-tim-cho-tre-em-tren-dia-ban-tinh-dien-bien5df3c727f11de', '/uploads/1576257319_6936274_1b904dc6f3878d973c59214752ebaeac.png', '2019-12-13 17:15:19', '2019-12-13 17:15:19');